Bad Advice (Split Scenes)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Keep your friends close, and your frenemies closer.Most people have the best intentions, but not always! Pampered housewife Karen has little to do besides listen to gossip at the salon. But when the topic turns to her own husband's infidelity, she goes off the rails and the accusations fly! Now convinced of his cheating ways, she starts her own journey through online dating with sexy, exciting and unexpected results. Bad Advice. You never know where it's going to land you!

Cast: Brandi Love, - (bio), Katrina Jade, Keira Nicole, Janet Mason, Sarah Vandella, Kleio, Erik Everhard, Tommy Gunn, Ryan Mclane, Tommy Pistol, Jonathan Morgan,Director

